const e={halloweenCharactersDefinitions:[{id:1,eng:"This creature (\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) is known for its insatiable (\u043D\u0435\u043D\u0430\u0441\u044B\u0442\u043D\u044B\u0439) hunger for human flesh. It's typically reanimated (\u0432\u043E\u0441\u0441\u0442\u0430\u0432\u0448\u0438\u0439) and mindless, often portrayed as emerging from a grave. Unlike a ghost, it has a physical body.",ru:"\u042D\u0442\u043E \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E \u0441\u0432\u043E\u0438\u043C \u043D\u0435\u043D\u0430\u0441\u044B\u0442\u043D\u044B\u043C \u0433\u043E\u043B\u043E\u0434\u043E\u043C \u043A \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u0435\u0441\u043A\u043E\u0439 \u043F\u043B\u043E\u0442\u0438. \u041E\u0431\u044B\u0447\u043D\u043E \u043E\u043D\u043E \u0432\u043E\u0441\u0441\u0442\u0430\u0432\u0448\u0435\u0435 \u0438 \u0431\u0435\u0437\u043C\u043E\u0437\u0433\u043B\u043E\u0435, \u0447\u0430\u0441\u0442\u043E \u0435\u0433\u043E \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0430\u044E\u0442 \u0432\u044B\u0445\u043E\u0434\u044F\u0449\u0438\u043C \u0438\u0437 \u043C\u043E\u0433\u0438\u043B\u044B. \u0412 \u043E\u0442\u043B\u0438\u0447\u0438\u0435 \u043E\u0442 \u043F\u0440\u0438\u0437\u0440\u0430\u043A\u0430, \u0443 \u043D\u0435\u0433\u043E \u0435\u0441\u0442\u044C \u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0442\u0435\u043B\u043E.",ans:"Zombie"},{id:2,eng:"This mythical being undergoes a transformation from a human into a fearsome, wolf-like creature(\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) during a full moon. The change is often painful and involuntary (\u043D\u0435\u043F\u0440\u043E\u0438\u0437\u0432\u043E\u043B\u044C\u043D\u044B\u0439).",ru:"\u042D\u0442\u043E \u043C\u0438\u0444\u0438\u0447\u0435\u0441\u043A\u043E\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E \u043F\u0440\u0435\u0442\u0435\u0440\u043F\u0435\u0432\u0430\u0435\u0442 \u043F\u0440\u0435\u0432\u0440\u0430\u0449\u0435\u043D\u0438\u0435 \u0438\u0437 \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430 \u0432 \u0441\u0432\u0438\u0440\u0435\u043F\u043E\u0435, \u0432\u043E\u043B\u043A\u043E\u043F\u043E\u0434\u043E\u0431\u043D\u043E\u0435 \u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435 \u0432\u043E \u0432\u0440\u0435\u043C\u044F \u043F\u043E\u043B\u043D\u043E\u043B\u0443\u043D\u0438\u044F. \u041F\u0435\u0440\u0435\u043C\u0435\u043D\u0430 \u0447\u0430\u0441\u0442\u043E \u0431\u044B\u0432\u0430\u0435\u0442 \u0431\u043E\u043B\u0435\u0437\u043D\u0435\u043D\u043D\u043E\u0439 \u0438 \u043D\u0435\u043F\u0440\u043E\u0438\u0437\u0432\u043E\u043B\u044C\u043D\u043E\u0439.",ans:"Werewolf"},{id:3,eng:"This character is a specific type of undead creature(\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) that is bound in wrappings (\u043F\u0435\u043B\u0435\u043D\u0430) and originates from ancient Egyptian lore. It is often discovered in a cursed tomb.",ru:"\u042D\u0442\u043E\u0442 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436 \u2014 \u043E\u0441\u043E\u0431\u044B\u0439 \u0432\u0438\u0434 \u043D\u0435\u0436\u0438\u0442\u0438, \u0437\u0430\u0432\u0451\u0440\u043D\u0443\u0442\u044B\u0439 \u0432 \u043F\u043E\u0433\u0440\u0435\u0431\u0430\u043B\u044C\u043D\u044B\u0435 \u043F\u0435\u043B\u0435\u043D\u0430 \u0438 \u0431\u0435\u0440\u0443\u0449\u0438\u0439 \u043D\u0430\u0447\u0430\u043B\u043E \u0438\u0437 \u0434\u0440\u0435\u0432\u043D\u0435\u0435\u0433\u0438\u043F\u0435\u0442\u0441\u043A\u043E\u0433\u043E \u0444\u043E\u043B\u044C\u043A\u043B\u043E\u0440\u0430. \u0415\u0433\u043E \u0447\u0430\u0441\u0442\u043E \u043D\u0430\u0445\u043E\u0434\u044F\u0442 \u0432 \u043F\u0440\u043E\u043A\u043B\u044F\u0442\u043E\u0439 \u0433\u0440\u043E\u0431\u043D\u0438\u0446\u0435.",ans:"Mummy"},{id:4,eng:"This being is a classic symbol of death itself. It is often depicted as a skeletal figure wearing a long, dark robe and carrying a scythe (\u043A\u043E\u0441\u0430), coming to collect souls.",ru:"\u042D\u0442\u043E \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E \u2014 \u043A\u043B\u0430\u0441\u0441\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0441\u0438\u043C\u0432\u043E\u043B \u0441\u0430\u043C\u043E\u0439 \u0441\u043C\u0435\u0440\u0442\u0438. \u0415\u0433\u043E \u0447\u0430\u0441\u0442\u043E \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0430\u044E\u0442 \u0432 \u0432\u0438\u0434\u0435 \u0441\u043A\u0435\u043B\u0435\u0442\u0430 \u0432 \u0434\u043B\u0438\u043D\u043D\u043E\u043C \u0442\u0451\u043C\u043D\u043E\u043C \u0431\u0430\u043B\u0430\u0445\u043E\u043D\u0435 \u0441 \u043A\u043E\u0441\u043E\u0439, \u043F\u0440\u0438\u0448\u0435\u0434\u0448\u0435\u0433\u043E, \u0447\u0442\u043E\u0431\u044B \u0437\u0430\u0431\u0440\u0430\u0442\u044C \u0434\u0443\u0448\u0438.",ans:"Grim Reaper"},{id:5,eng:"This is not a single character, but a title. He is a notorious (\u043F\u0435\u0447\u0430\u043B\u044C\u043D\u043E \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0439) historical figure from London whose identity remains a mystery. He is often portrayed with a cloak and top hat, preying on women in foggy streets.",ru:"\u042D\u0442\u043E \u043D\u0435 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u044B\u0439 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436, \u0430 \u043F\u0440\u043E\u0437\u0432\u0438\u0449\u0435. \u041E\u043D \u2014 \u043F\u0435\u0447\u0430\u043B\u044C\u043D\u043E \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u0430\u044F \u0438\u0441\u0442\u043E\u0440\u0438\u0447\u0435\u0441\u043A\u0430\u044F \u043B\u0438\u0447\u043D\u043E\u0441\u0442\u044C \u0438\u0437 \u041B\u043E\u043D\u0434\u043E\u043D\u0430, \u0447\u044C\u044F \u043B\u0438\u0447\u043D\u043E\u0441\u0442\u044C \u043E\u0441\u0442\u0430\u0451\u0442\u0441\u044F \u0437\u0430\u0433\u0430\u0434\u043A\u043E\u0439. \u0415\u0433\u043E \u0447\u0430\u0441\u0442\u043E \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0430\u044E\u0442 \u0432 \u043F\u043B\u0430\u0449\u0435 \u0438 \u0446\u0438\u043B\u0438\u043D\u0434\u0440\u0435, \u043E\u0445\u043E\u0442\u044F\u0449\u0438\u043C\u0441\u044F \u043D\u0430 \u0436\u0435\u043D\u0449\u0438\u043D \u043D\u0430 \u0442\u0443\u043C\u0430\u043D\u043D\u044B\u0445 \u0443\u043B\u0438\u0446\u0430\u0445.",ans:"Jack the Ripper"},{id:6,eng:"This creature(\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) is a shapeshifter (\u043E\u0431\u043E\u0440\u043E\u0442\u0435\u043D\u044C) from Native American folklore. It is a malevolent (\u0437\u043B\u043E\u0431\u043D\u044B\u0439), cannibalistic spirit associated with winter, cold, and famine (\u0433\u043E\u043B\u043E\u0434). It is often depicted with animal features like antlers (\u0440\u043E\u0433\u0430).",ru:"\u042D\u0442\u043E \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E \u2014 \u043E\u0431\u043E\u0440\u043E\u0442\u0435\u043D\u044C \u0438\u0437 \u0444\u043E\u043B\u044C\u043A\u043B\u043E\u0440\u0430 \u043A\u043E\u0440\u0435\u043D\u043D\u044B\u0445 \u0430\u043C\u0435\u0440\u0438\u043A\u0430\u043D\u0446\u0435\u0432. \u042D\u0442\u043E \u0437\u043B\u043E\u0431\u043D\u044B\u0439, \u043A\u0430\u043D\u043D\u0438\u0431\u0430\u043B\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u0434\u0443\u0445, \u0430\u0441\u0441\u043E\u0446\u0438\u0438\u0440\u0443\u044E\u0449\u0438\u0439\u0441\u044F \u0441 \u0437\u0438\u043C\u043E\u0439, \u0445\u043E\u043B\u043E\u0434\u043E\u043C \u0438 \u0433\u043E\u043B\u043E\u0434\u043E\u043C. \u0415\u0433\u043E \u0447\u0430\u0441\u0442\u043E \u0438\u0437\u043E\u0431\u0440\u0430\u0436\u0430\u044E\u0442 \u0441 \u0436\u0438\u0432\u043E\u0442\u043D\u044B\u043C\u0438 \u0447\u0435\u0440\u0442\u0430\u043C\u0438, \u0442\u0430\u043A\u0438\u043C\u0438 \u043A\u0430\u043A \u0440\u043E\u0433\u0430.",ans:"Wendigo"},{id:7,eng:"This character is a specific, iconic clown from a Stephen King novel. It primarily preys on children, exploiting their deepest fears, and often appears in the sewers (\u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u044F). Its favorite phrase is, 'We all float down here!'",ru:"\u042D\u0442\u043E\u0442 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436 \u2014 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u044B\u0439, \u043A\u0443\u043B\u044C\u0442\u043E\u0432\u044B\u0439 \u043A\u043B\u043E\u0443\u043D \u0438\u0437 \u0440\u043E\u043C\u0430\u043D\u0430 \u0421\u0442\u0438\u0432\u0435\u043D\u0430 \u041A\u0438\u043D\u0433\u0430. \u041E\u043D \u0432 \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u043C \u043E\u0445\u043E\u0442\u0438\u0442\u0441\u044F \u043D\u0430 \u0434\u0435\u0442\u0435\u0439, \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u044F \u0438\u0445 \u0441\u0430\u043C\u044B\u0435 \u0433\u043B\u0443\u0431\u043E\u043A\u0438\u0435 \u0441\u0442\u0440\u0430\u0445\u0438, \u0438 \u0447\u0430\u0441\u0442\u043E \u043F\u043E\u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u0432 \u043A\u0430\u043D\u0430\u043B\u0438\u0437\u0430\u0446\u0438\u0438. \u0415\u0433\u043E \u043B\u044E\u0431\u0438\u043C\u0430\u044F \u0444\u0440\u0430\u0437\u0430: \xAB\u041C\u044B \u0432\u0441\u0435 \u0442\u0443\u0442 \u043F\u043B\u0430\u0432\u0430\u0435\u043C!\xBB",ans:"Pennywise"},{id:8,eng:"This being is a demonic entity from folklore that takes the form of a beautiful woman to seduce men in their dreams, often feeding on their life force or energy.",ru:"\u042D\u0442\u043E \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E \u2014 \u0434\u0435\u043C\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0430\u044F \u0441\u0443\u0449\u043D\u043E\u0441\u0442\u044C \u0438\u0437 \u0444\u043E\u043B\u044C\u043A\u043B\u043E\u0440\u0430, \u043A\u043E\u0442\u043E\u0440\u0430\u044F \u043F\u0440\u0438\u043D\u0438\u043C\u0430\u0435\u0442 \u0444\u043E\u0440\u043C\u0443 \u043F\u0440\u0435\u043A\u0440\u0430\u0441\u043D\u043E\u0439 \u0436\u0435\u043D\u0449\u0438\u043D\u044B, \u0447\u0442\u043E\u0431\u044B \u0441\u043E\u0431\u043B\u0430\u0437\u043D\u044F\u0442\u044C \u043C\u0443\u0436\u0447\u0438\u043D \u0432 \u0438\u0445 \u0441\u043D\u0430\u0445, \u0447\u0430\u0441\u0442\u043E \u043F\u0438\u0442\u0430\u044F\u0441\u044C \u0438\u0445 \u0436\u0438\u0437\u043D\u0435\u043D\u043D\u043E\u0439 \u0441\u0438\u043B\u043E\u0439 \u0438\u043B\u0438 \u044D\u043D\u0435\u0440\u0433\u0438\u0435\u0439.",ans:"Succubus"},{id:9,eng:"This creature(\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) is a monstrous, three-headed dog from Greek mythology. It guards the entrance to the underworld to prevent the dead from leaving.",ru:"\u042D\u0442\u043E \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E \u2014 \u0447\u0443\u0434\u043E\u0432\u0438\u0449\u043D\u044B\u0439 \u0442\u0440\u0451\u0445\u0433\u043B\u0430\u0432\u044B\u0439 \u043F\u0451\u0441 \u0438\u0437 \u0433\u0440\u0435\u0447\u0435\u0441\u043A\u043E\u0439 \u043C\u0438\u0444\u043E\u043B\u043E\u0433\u0438\u0438. \u041E\u043D \u043E\u0445\u0440\u0430\u043D\u044F\u0435\u0442 \u0432\u0445\u043E\u0434 \u0432 \u043F\u043E\u0434\u0437\u0435\u043C\u043D\u044B\u0439 \u043C\u0438\u0440, \u0447\u0442\u043E\u0431\u044B \u043C\u0451\u0440\u0442\u0432\u044B\u0435 \u043D\u0435 \u043C\u043E\u0433\u043B\u0438 \u0432\u044B\u0439\u0442\u0438.",ans:"Cerberus"},{id:10,eng:"This is an evil spirit or monster from Arabic folklore that dwells (\u043E\u0431\u0438\u0442\u0430\u0435\u0442) in cemeteries and consumes human flesh. It is often confused with a zombie but is considered a type of shapeshifting demon.",ru:"\u042D\u0442\u043E \u0437\u043B\u043E\u0439 \u0434\u0443\u0445 \u0438\u043B\u0438 \u043C\u043E\u043D\u0441\u0442\u0440 \u0438\u0437 \u0430\u0440\u0430\u0431\u0441\u043A\u043E\u0433\u043E \u0444\u043E\u043B\u044C\u043A\u043B\u043E\u0440\u0430, \u043A\u043E\u0442\u043E\u0440\u044B\u0439 \u043E\u0431\u0438\u0442\u0430\u0435\u0442 \u043D\u0430 \u043A\u043B\u0430\u0434\u0431\u0438\u0449\u0430\u0445 \u0438 \u043F\u043E\u0436\u0438\u0440\u0430\u0435\u0442 \u0447\u0435\u043B\u043E\u0432\u0435\u0447\u0435\u0441\u043A\u0443\u044E \u043F\u043B\u043E\u0442\u044C. \u0415\u0433\u043E \u0447\u0430\u0441\u0442\u043E \u043F\u0443\u0442\u0430\u044E\u0442 \u0441 \u0437\u043E\u043C\u0431\u0438, \u043D\u043E \u043E\u043D \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044F \u0440\u0430\u0437\u043D\u043E\u0432\u0438\u0434\u043D\u043E\u0441\u0442\u044C\u044E \u0434\u0435\u043C\u043E\u043D\u0430-\u043E\u0431\u043E\u0440\u043E\u0442\u043D\u044F.",ans:"Ghoul"},{id:11,eng:"This character is a specific, reanimated creature(\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) brought to life through a scientific experiment. It is often misunderstood and seeks acceptance, famously saying, 'Fire bad!'",ru:"\u042D\u0442\u043E\u0442 \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u0436 \u2014 \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u043E\u0435, \u043E\u0436\u0438\u0432\u043B\u0451\u043D\u043D\u043E\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E, \u0432\u043E\u0437\u0432\u0440\u0430\u0449\u0451\u043D\u043D\u043E\u0435 \u043A \u0436\u0438\u0437\u043D\u0438 \u0441 \u043F\u043E\u043C\u043E\u0449\u044C\u044E \u043D\u0430\u0443\u0447\u043D\u043E\u0433\u043E \u044D\u043A\u0441\u043F\u0435\u0440\u0438\u043C\u0435\u043D\u0442\u0430. \u0415\u0433\u043E \u0447\u0430\u0441\u0442\u043E \u043D\u0435\u043F\u0440\u0430\u0432\u0438\u043B\u044C\u043D\u043E \u043F\u043E\u043D\u0438\u043C\u0430\u044E\u0442, \u0438 \u043E\u043D \u0438\u0449\u0435\u0442 \u043F\u0440\u0438\u043D\u044F\u0442\u0438\u044F, \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u044B\u0439 \u0444\u0440\u0430\u0437\u043E\u0439 \xAB\u041E\u0433\u043E\u043D\u044C \u043F\u043B\u043E\u0445\u043E!\xBB",ans:"Frankenstein's Monster"},{id:12,eng:"This is a ghostly doppelg\xE4nger or double of a living person. Seeing one is considered a very bad omen (\u0434\u0443\u0440\u043D\u043E\u0435 \u043F\u0440\u0435\u0434\u0437\u043D\u0430\u043C\u0435\u043D\u043E\u0432\u0430\u043D\u0438\u0435), often a sign of impending (\u043D\u0430\u0434\u0432\u0438\u0433\u0430\u044E\u0449\u0435\u0439\u0441\u044F) illness or death.",ru:"\u042D\u0442\u043E \u043F\u0440\u0438\u0437\u0440\u0430\u0447\u043D\u044B\u0439 \u0434\u0432\u043E\u0439\u043D\u0438\u043A \u0436\u0438\u0432\u043E\u0433\u043E \u0447\u0435\u043B\u043E\u0432\u0435\u043A\u0430. \u0421\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044F, \u0447\u0442\u043E \u0443\u0432\u0438\u0434\u0435\u0442\u044C \u0435\u0433\u043E \u2014 \u043E\u0447\u0435\u043D\u044C \u0434\u0443\u0440\u043D\u043E\u0435 \u043F\u0440\u0435\u0434\u0437\u043D\u0430\u043C\u0435\u043D\u043E\u0432\u0430\u043D\u0438\u0435, \u0447\u0430\u0441\u0442\u043E \u0437\u043D\u0430\u043A \u043D\u0430\u0434\u0432\u0438\u0433\u0430\u044E\u0449\u0435\u0439\u0441\u044F \u0431\u043E\u043B\u0435\u0437\u043D\u0438 \u0438\u043B\u0438 \u0441\u043C\u0435\u0440\u0442\u0438.",ans:"Doppelganger"},{id:13,eng:"This is a specific witch from Slavic folklore. She lives in a hut (\u0438\u0437\u0431\u0443\u0448\u043A\u0430) that stands on chicken legs and flies around in a mortar (\u0441\u0442\u0443\u043F\u0430), using a pestle (\u043F\u0435\u0441\u0442) as an oar (\u0432\u0435\u0441\u043B\u043E).",ru:"\u042D\u0442\u043E \u043A\u043E\u043D\u043A\u0440\u0435\u0442\u043D\u0430\u044F \u0432\u0435\u0434\u044C\u043C\u0430 \u0438\u0437 \u0441\u043B\u0430\u0432\u044F\u043D\u0441\u043A\u043E\u0433\u043E \u0444\u043E\u043B\u044C\u043A\u043B\u043E\u0440\u0430. \u041E\u043D\u0430 \u0436\u0438\u0432\u0451\u0442 \u0432 \u0438\u0437\u0431\u0443\u0448\u043A\u0435 \u043D\u0430 \u043A\u0443\u0440\u044C\u0438\u0445 \u043D\u043E\u0436\u043A\u0430\u0445 \u0438 \u043B\u0435\u0442\u0430\u0435\u0442 \u0432 \u0441\u0442\u0443\u043F\u0435, \u0438\u0441\u043F\u043E\u043B\u044C\u0437\u0443\u044F \u043F\u0435\u0441\u0442 \u043A\u0430\u043A \u0432\u0435\u0441\u043B\u043E.",ans:"Baba Yaga"},{id:14,eng:"This is a mischievous (\u043E\u0437\u043E\u0440\u043D\u043E\u0439) and destructive creature(\u0441\u043E\u0437\u0434\u0430\u043D\u0438\u0435, \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E) that becomes even more dangerous when exposed to water or after midnight. It is known for causing mechanical failures.",ru:"\u042D\u0442\u043E \u043E\u0437\u043E\u0440\u043D\u043E\u0435 \u0438 \u0440\u0430\u0437\u0440\u0443\u0448\u0438\u0442\u0435\u043B\u044C\u043D\u043E\u0435 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043E, \u043A\u043E\u0442\u043E\u0440\u043E\u0435 \u0441\u0442\u0430\u043D\u043E\u0432\u0438\u0442\u0441\u044F \u0435\u0449\u0451 \u043E\u043F\u0430\u0441\u043D\u0435\u0435 \u043F\u0440\u0438 \u043A\u043E\u043D\u0442\u0430\u043A\u0442\u0435 \u0441 \u0432\u043E\u0434\u043E\u0439 \u0438\u043B\u0438 \u043F\u043E\u0441\u043B\u0435 \u043F\u043E\u043B\u0443\u043D\u043E\u0447\u0438. \u041E\u043D\u043E \u0438\u0437\u0432\u0435\u0441\u0442\u043D\u043E \u0442\u0435\u043C, \u0447\u0442\u043E \u0432\u044B\u0437\u044B\u0432\u0430\u0435\u0442 \u043F\u043E\u043B\u043E\u043C\u043A\u0438 \u043C\u0435\u0445\u0430\u043D\u0438\u0437\u043C\u043E\u0432.",ans:"Gremlin"},{id:15,eng:"This is a demonic dog from folklore, often of enormous (\u0433\u0440\u043E\u043C\u0430\u0434\u043D\u043E\u0433\u043E) size and with glowing red eyes. It is an omen (\u043F\u0440\u0435\u0434\u0437\u043D\u0430\u043C\u0435\u043D\u043E\u0432\u0430\u043D\u0438\u0435) of death and is said to serve the Devil, haunting graveyards and lonely roads.",ru:"\u042D\u0442\u043E \u0434\u0435\u043C\u043E\u043D\u0438\u0447\u0435\u0441\u043A\u0438\u0439 \u043F\u0451\u0441 \u0438\u0437 \u0444\u043E\u043B\u044C\u043A\u043B\u043E\u0440\u0430, \u0447\u0430\u0441\u0442\u043E \u0433\u0440\u043E\u043C\u0430\u0434\u043D\u043E\u0433\u043E \u0440\u0430\u0437\u043C\u0435\u0440\u0430 \u0438 \u0441\u043E \u0441\u0432\u0435\u0442\u044F\u0449\u0438\u043C\u0438\u0441\u044F \u043A\u0440\u0430\u0441\u043D\u044B\u043C\u0438 \u0433\u043B\u0430\u0437\u0430\u043C\u0438. \u041E\u043D \u044F\u0432\u043B\u044F\u0435\u0442\u0441\u044F \u043F\u0440\u0435\u0434\u0432\u0435\u0441\u0442\u043D\u0438\u043A\u043E\u043C \u0441\u043C\u0435\u0440\u0442\u0438 \u0438, \u043A\u0430\u043A \u0433\u043E\u0432\u043E\u0440\u044F\u0442, \u0441\u043B\u0443\u0436\u0438\u0442 \u0414\u044C\u044F\u0432\u043E\u043B\u0443, \u0431\u0440\u043E\u0434\u044F \u043F\u043E \u043A\u043B\u0430\u0434\u0431\u0438\u0449\u0430\u043C \u0438 \u0431\u0435\u0437\u043B\u044E\u0434\u043D\u044B\u043C \u0434\u043E\u0440\u043E\u0433\u0430\u043C.",ans:"Hellhound"}]};export{e as d};
